import React from 'react';
import './App.css';
import emotion from "./Icons/Small Icons/mood-24px-grey.svg";
import tactor from "./Icons/Small Icons/tactor-grey.svg";
import behavior from "./Icons/Small Icons/touch-grey.svg";
import neutral from "./Icons/Emotion/Emotion_Neutral.svg";
import squeezeb from "./Icons/Tactor/Gesture icons_Squeeze-15.svg";
import happiness from "./Icons/Emotion/Emotion_Happiness .svg";
import fear from "./Icons/Emotion/Emotion_Fear.svg";
import sympathy from "./Icons/Emotion/Emotion_Sympathy.svg";
import sadness from "./Icons/Emotion/Emotion_Sadness.svg";
import anger from "./Icons/Emotion/Emotion_Anger.svg";
import disgust from "./Icons/Emotion/Emotion_Disgust.svg";
import love from "./Icons/Emotion/Emotion_Love.svg";
import gratitude from "./Icons/Emotion/Emotion_Gratitude.svg";
import shakew from "./Icons/Tactor/Gesture icons_Shake_wht.svg"
import squeezew from "./Icons/Tactor/Gesture icons_Squeeze_wht.svg";
import hitb from "./Icons/Tactor/Gesture icons_Hit.svg";
import patb from "./Icons/Tactor/Gesture icons_Pat-14.svg";
import pushb from "./Icons/Tactor/Gesture icons_Push-21.svg";
import rubb from "./Icons/Tactor/Gesture icons_Rub-18.svg";
import strokeb from "./Icons/Tactor/Gesture icons_Stroke.svg";
import tapb from "./Icons/Tactor/Gesture icons_Tap-17.svg";
import trange from "./Icons/Small Icons/touch_range.svg";
import tspeed from "./Icons/Small Icons/speed-touch.svg";
import rspeed from "./Icons/Small Icons/speed_retreat.svg";
import randomness from "./Icons/Small Icons/Touch_randomness.svg";
import tint from "./Icons/Small Icons/touch_interval.svg";
import irand from "./Icons/Small Icons/interval_randomness.svg";
import play from "./Icons/play-filled.svg";
import pause from "./Icons/pause-filled.svg";
import arrow from "./Icons/Small Icons/arrow.svg";
import Emotion from './emotion';

//TO DO: Add the emotion and placeholders to the left bar.
//Allow users to go home with the top navigation
//Allow users to clear selection of tactor and emotion
//Add graph and sliders
//Add serial library
//Add Archive


class LeftNav extends React.Component{



constructor(props) {
  super(props);
  this.state = {
    home: true,
    emotion: false,
    tactor: false,
    behavior: false,
    eselected:false,
    eicon: null,
    ename: null,
    tselected:false,
    ticon: null,
    tname: null,
    trange:null,
    tspeed:null,
    rspeed:null,
    randomness:null,
    tint:null,
    irand:null,
  };
}

handleClick(name) {
  switch (name) {
    case "emotion":
      this.setState({ home: false, emotion:true, tactor: false, behavior: false});
      break;
    case "tactor":
      this.setState({home: false, emotion: false, tactor: true, behavior: false});
      break;
    case "behavior":
      this.setState({home: false, emotion: false, tactor: false, behavior: true});
      break;
  }
}

emotionSelect(name){
this.setState({eselected:true});
  switch (name) {
    case "happiness":
      this.setState({eicon:happiness, ename: "Happiness"});
      break;
    case "fear":
        this.setState({eicon:fear, ename: "Fear"});
        break;
    case "sympathy":
        this.setState({eicon: sympathy, ename: "Sympathy"});
        break;
    case "sadness":
      this.setState({eicon: sadness, ename: "Sadness"});
      break;
    case "anger":
      this.setState({eicon: anger, ename: "Anger"});
      break;
    case "disgust":
      this.setState({eicon: disgust, ename:"Disgust"});
      break;
    case "love":
      this.setState({eicon: love, ename: "Love"});
      break;
    case "gratitude":
      this.setState({eicon: gratitude, ename:"Gratitude"});

  }
}

tactorSelect(name){
this.setState({tselected:true});
  var shake = shakew;
  var squeeze = squeezew;
  var hit = hitb;
  var pat = patb;
  var push = pushb;
  var rub = rubb;
  var stroke = strokeb;
  var tap = tapb;

  switch (name) {
    case "shake":
      this.setState({ticon:shake, tname: "Shake"});
      break;
    case "squeeze":
        this.setState({ticon:squeeze, tname: "Squeeze"});
        break;
    case "hit":
        this.setState({ticon: hit, tname: "Hit"});
        break;
    case "pat":
      this.setState({ticon: pat, tname: "Pat"});
      break;
    case "push":
      this.setState({ticon: push, tname: "Push"});
      break;
    case "rub":
      this.setState({ticon: rub, tname:"Rub"});
      break;
    case "stroke":
      this.setState({ticon: stroke, tname: "Stroke"});
      break;
    case "tap":
      this.setState({ticon: tap, tname:"Tap"});
      break;
  }
}


handleSlider(name){
switch (name) {
  case "trange":
      this.setState({trange: document.getElementById("touch-range").value});
    break;
  case "tspeed":
      this.setState({tspeed: document.getElementById("speed-touch").value});
    break;
  case "rspeed":
      this.setState({rspeed: document.getElementById("speed-retreat").value});
    break;
  case "randomness":
      this.setState({randomness: document.getElementById("touch-randomness").value});
    break;
  case "tint":
      this.setState({ting: document.getElementById("touch-interval").value});
    break;
  case "irand":
      this.setState({irand: document.getElementById("interval-randomness").value});
    break;
}

}


  render(){
    var shake = shakew;
    var squeeze = squeezew;
    var hit = hitb;
    var pat = patb;
    var push = pushb;
    var rub = rubb;
    var stroke = strokeb;
    var tap = tapb;


  return(

      <section class="page-content">
            <div class ="row left-nav group1">
              <div class="col-2 bg-light  sidebar d-flex">
                <div class ="row left-nav group1">
                <div class="col-12 left-col">
                <nav class="navbar left-nav navbar-expand navbar-light">
                <ul class="left-nav nav-item text-left">
                  <li class="left-nav nav-link" href="#"  onClick={() => this.handleClick("emotion")}><a class="left-nav nav-link"><img src={emotion} alt="" class="left-nav icon"/>Emotion</a></li>
                  {this.state.eselected && (
                  <div class="row justify-content-center">
                    <div class="col col-auto bg-white sidebar-emotion-box">
                      <img src={this.state.eicon} alt="" class="emotion-logo happiness sidebar-emotion" />
                      <h4 class="text-center">{this.state.ename}</h4>
                    </div>
                  </div>
                )}
                  <li class="left-nav nav-link" href="#" onClick={() => this.handleClick("tactor")}><a class="left-nav nav-link" ><img src={tactor} alt="" class="left-nav icon"/>Tactor</a></li>
                  {this.state.tselected && (
                  <div class="row justify-content-center">
                    <div class="col col-auto bg-white sidebar-tactor-box">
                      <img src={this.state.ticon} alt="" class="tactor-logo happiness sidebar-tactor"/>
                      <h4 class="text-center">{this.state.tname}</h4>
                    </div>
                  </div>
                )}
                  <li class="left-nav nav-link" href="#"><a class="left-nav nav-link" onClick={() => this.handleClick("behavior")}><img src={behavior} alt="" class="left-nav icon"/>Behavior</a></li>
                </ul>
              </nav>
                </div>
                </div>

              </div>
              {this.state.home && (

              <div class="col-10 main-content">
              <section class="main-head">


                <h2>Touch Generator</h2>
                <h3>Create a new emotional robot touch clip</h3>

              </section>
              <section class="generator-table">
                <div class="row generator justify-content-center">
                  <div class="col col-auto" >
                    <div class="bg-light touchgen-box touchgen d-flex align-items-center" onClick={() => this.handleClick("emotion")}>
                    <img src={neutral} alt="" class="generator-logo"/>
                  </div>

                    <h4 class="text-center text-uppercase mx-auto">Emotion</h4>

                  </div>
                  <div class="col col-auto d-flex align-items-center">
                    <h2 class="generator">OR</h2>
                    </div>
                  <div class="col col-auto">
                    <div class="bg-light  touchgen-box  touchgen d-flex align-items-center" onClick={() => this.handleClick("tactor")}>
                      <img src={squeezeb} alt="" class="generator-logo"/>
                    </div>
                    <h4 class="text-center text-uppercase mx-auto">Tactor</h4>
                  </div>
                </div>

              </section>
              </div>
            )}
            {this.state.emotion && (
              <div class="col-10 main-content">
              <section class="main-head">


                <h2>Emotion</h2>
                <h3>Select one emotion to start</h3>

              </section>
              <section class="emotion-table">
                <div class="row emotion">
                  <div class="col">
                    <div class="bg-light emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("happiness"), this.handleClick("tactor"))}>
                    <img src={happiness} alt="" class="emotion-logo happiness"/>
                  </div>

                    <h4 class="text-center">Happiness</h4>

                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("fear"), this.handleClick("tactor"))}>
                      <img src={fear} alt="" class="emotion-logo fear"/>
                    </div>
                    <h4 class="text-center">Fear</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center"  onClick={() => (this.emotionSelect("sympathy"), this.handleClick("tactor"))}>
                        <img src={sympathy} alt="" class="emotion-logo sympathy"/>
                    </div>
                    <h4 class="text-center">Sympathy</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center"  onClick={() => (this.emotionSelect("sadness"), this.handleClick("tactor"))}>
                      <img src={sadness} alt="" class="emotion-logo sadness"/>
                    </div>
                    <h4 class="text-center">Sadness</h4>
                  </div>
                </div>
                <div class="row emotion">
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("anger"), this.handleClick("tactor"))}>
                      <img src={anger} alt="" class="emotion-logo anger"/>
                  </div>
                  <h4 class="text-center">Anger</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("disgust"), this.handleClick("tactor"))}>
                      <img src={disgust} alt="" class="emotion-logo disgust"/>
                    </div>
                    <h4 class="text-center">Disgust</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("love"), this.handleClick("tactor"))}>
                      <img src={love} alt="" class="emotion-logo love"/>
                    </div>
                    <h4 class="text-center">Love</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("gratitude"), this.handleClick("tactor"))}>
                      <img src={gratitude} alt="" class="emotion-logo gratitude"/>
                    </div>
                    <h4 class="text-center">Gratitude</h4>
                  </div>
                </div>
              </section>
            </div>

            )}
            {this.state.tactor && (
              <div class="col-10 main-content">
                <section class="main-head">


                  <h2>Tactor</h2>
                  <h3>Select one tactor, recommendation is provided based on study</h3>

                </section>
                <section class="emotion-table">
                  <div class="row emotion">
                    <div class="col">
                      <div class="bg-dark emotion-box emotion d-flex align-items-center" onClick={() => (this.tactorSelect("shake"), this.handleClick("behavior"))}>
                      <img src={shake} alt="" class="emotion-logo happiness"/>
                    </div>

                      <h4 class="text-center">Shake</h4>

                    </div>
                    <div class="col">
                      <div class="bg-dark  emotion-box emotion d-flex align-items-center" onClick={() => (this.tactorSelect("squeeze"), this.handleClick("behavior"))}>
                        <img src={squeeze} alt="" class="emotion-logo fear"/>
                      </div>
                      <h4 class="text-center">Squeeze</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.tactorSelect("hit"), this.handleClick("behavior"))}>
                          <img src={hit} alt="" class="emotion-logo sympathy"/>
                      </div>
                      <h4 class="text-center">Hit</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.tactorSelect("pat"), this.handleClick("behavior"))}>
                        <img src={pat} alt="" class="emotion-logo sadness"/>
                      </div>
                      <h4 class="text-center">Pat</h4>
                    </div>
                  </div>
                  <div class="row emotion">
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.tactorSelect("push"), this.handleClick("behavior"))}>
                        <img src={push} alt="" class="emotion-logo anger"/>
                    </div>
                    <h4 class="text-center">Push</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.tactorSelect("rub"), this.handleClick("behavior"))}>
                        <img src={rub} alt="" class="emotion-logo disgust"/>
                      </div>
                      <h4 class="text-center">Rub</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.tactorSelect("stroke"), this.handleClick("behavior"))}>
                        <img src={stroke} alt="" class="emotion-logo love"/>
                      </div>
                      <h4 class="text-center">Stroke</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.tactorSelect("tap"), this.handleClick("behavior"))}>
                        <img src={tap} alt="" class="emotion-logo gratitude"/>
                      </div>
                      <h4 class="text-center">Tap</h4>
                    </div>
                  </div>
                </section>
              </div>
            )}
            {this.state.behavior && (
              <div class="col-10 main-content">
                <section class="main-head">


                  <h2>Touch</h2>
                  <h3>Default setting recommended range are showed in the dashboard</h3>

                </section>
                <section class="touch-config">
                  <div class="row touch">
                    <div class="col">
                      <div class="bg-light dashboard-box">
                          <h4 class="">Dashboard</h4>
                          <div class="slider-div">
                            <h6 class="slider-label">Touch Range (degree)</h6>
                            <h6 class="slider-value float-right">{this.state.trange}</h6>
                            <br/>
                            <img src={trange} alt="" class="slider-icon"/>
                          <input type="range" class="slider" id="touch-range" name="touch-range" onInput={() => (this.handleSlider("trange"))} onChange={() => (this.handleSlider("trange"))} min="0" max="180" step="10" style="background: linear-gradient(90deg, rgba(255,255,255,1) 15%, rgba(156,156,156,1) 15%, rgba(156,156,156,1) 63%, rgba(255,255,255,1) 63%);"/>
                          </div>

                          <div class="slider-div">
                            <h6 class="slider-label">Speed of Touching (degree/s)</h6>
                            <h6 class="slider-value float-right">{this.state.tspeed}</h6>
                            <br/>
                            <img src={tspeed} alt="" class="slider-icon"/>
                          <input type="range" class="slider" id="speed-touch" name="speed-touch" onInput={() => (this.handleSlider("tspeed"))} onChange={() => (this.handleSlider("tspeed"))} min="0" max="360" step="15"/>
                          </div>

                          <div class="slider-div">
                            <h6 class="slider-label">Speed of Retreating (degree/s)</h6>
                            <h6 class="slider-value float-right">{this.state.rspeed}</h6>
                            <br/>
                            <img src={rspeed} alt="" class="slider-icon"/>
                          <input type="range" class="slider" id="speed-retreat" onInput={() => (this.handleSlider("rspeed"))} onChange={() => (this.handleSlider("rspeed"))} min="0" max="360" step="15"/>
                          </div>

                          <div class="slider-div">
                            <h6 class="slider-label">Touch Randomness (Tremble)</h6>
                            <h6 class="slider-value float-right">{this.state.randomness}</h6>
                            <br/>
                            <img src={randomness} alt="" class="slider-icon"/>
                          <input type="range" class="slider" id="touch-randomness" onInput={() => (this.handleSlider("randomness"))} onChange={() => (this.handleSlider("randomness"))} min="0" max="50" step="5"/>
                          </div>

                          <div class="slider-div">
                            <h6 class="slider-label">Touch Interval (ms)</h6>
                            <h6 class="slider-value float-right">{this.state.ting}</h6>
                            <br/>
                            <img src={tint} alt="" class="slider-icon"/>
                          <input type="range" class="slider" id="touch-interval" onInput={() => (this.handleSlider("tint"))} onChange={() => (this.handleSlider("tint"))} min="0" max="1000" step="10"/>
                          </div>

                          <div class="slider-div">
                            <h6 class="slider-label">Interval Randomness</h6>
                            <h6 class="slider-value float-right">{this.state.irand}</h6>
                            <br/>
                            <img src={irand} alt="" class="slider-icon"/>
                          <input type="range" class="slider" id="interval-randomness" onInput={() => (this.handleSlider("irand"))} onChange={() => (this.handleSlider("irand"))} min="0" max="300" step="10"/>
                          </div>
                    </div>



                    </div>
                    <div class="col">
                      <div class="bg-light  dashboard-box">
                          <h4 class="">Motion (degree/s)</h4>
                            <div class="graph">
                            </div>
                            <div class="d-flex justify-content-center pp">
                            <img src={play} alt="" id="play-icon" />
                            <img src={pause} alt="" id="pause-icon"/>
                          </div>
                      </div>
                      <div class="name-input">
                        <h6 class="name-label">Name</h6>
                        <input type="text" class="text-input" value="Timeline Sample 1"/>
                        <button class="archive float-right">
                        <h6 class="archive slider-label">Refer to Archive</h6>
                        <img src={arrow} alt="" class="archive"/>
                      </button>
                      </div>
                      <div class="buttons">
                        <button class="float-right align-items-center" id="save">
                        <h6>Save</h6>
                      </button>
                        <button class="float-right align-items-center" id="export">
                        <h6>Export</h6>
                      </button>

                      </div>
                    </div>



                  </div>
                  </section>
                </div>
            )}

              </div>
          </section>
)
}
}

export default LeftNav;
